import React from "react";
import { NextPage, NextPageContext } from "next";
import fetch from "isomorphic-unfetch";

interface IProps {}
const PriceBox: NextPage<IProps> = props => (
  <div className="card text-white bg-primary mb-3">
    <div className="card-header">Precio del BitCoin</div>
    <div className="card-body">
      <h4 className="card-title">Primary card title</h4>
      <p className="card-text">
        Some quick example text to build on the card title and make up the bulk
        of the card's content.
      </p>
    </div>
  </div>
);

PriceBox.getInitialProps = async ({ pathname }: NextPageContext) => {
  console.log("pass here");
  const result = await fetch("https://api.coinmarketcap.com/v2/ticker/1");
  const response = await result.json();
  console.log(response);

  return {};
};

export default PriceBox;
